import React from 'react';

const JournalList = ({ entries }) => {
    return (
        <div>
            {entries.map((entry, index) => (
                <div key={index} style={{ marginBottom: '20px', padding: '10px', border: '1px solid #eee', borderRadius: '8px' }}>
                    {entry.image && <img src={entry.image} alt="journal" style={{ maxWidth: '100%', borderRadius: '8px' }} />}
                    <p style={{ fontFamily: entry.font, whiteSpace: 'pre-wrap' }}>{entry.text}</p>
                </div>
            ))}
        </div>
    );
};

export default JournalList;
